window.bookSummaryJSON = "<p><b>Lothar the Usurper has stolen his brother's throne.</b></p> <p>Now, he sits upon it, plotting to remove his troublesome niece—Brekka's best warrior and the woman once expected to rule the kingdom. Her presence hangs over him like an axe—a constant threat to his ambitions, which stretch far beyond his already generous borders.</p> <p>When an unexpected visitor arrives, Lothar discovers a way to hurt Jael without ever getting his greedy hands dirty....</p> <p>Across the Nebbar Straights, Eirik Skalleson must find his son a wife to secure the future of his kingdom, but Eadmund has ruined everything he has tried so far.</p> <p>And now there is a woman, the daughter of an Alekkan lord. A flame-haired, freckle-nosed, smiling woman. Perfect in every way. Yet Eirik's dreamer daughter is worried.</p> <p>Trouble, she says. The woman is going to cause trouble....</p> <p>Kings of Fate <i>is a prequel to The Furyck Saga: a gripping six-part epic fantasy series that takes you into a richly-woven world of warring kingdoms, mysterious dreamers, dark magic, and an ancient prophecy that emerges from the darkness to weave a dangerous web around them all. Intended for mature listeners.</i></p>"; 
